import React from 'react';

const Choise = () => {

  return (
    <div>
      <input type="radio" id="radio1" name="radios" value="all" checked></input>
      <label for="radio1">iPhone</label>
      <input type="radio" id="radio2" name="radios" value="false"></input>
      <label for="radio2">Galaxy S IV</label>
      <input type="radio" id="radio3" name="radios" value="true"></input>
      <label for="radio3">Nexus S</label>
    </div>
  );

}
export default Choise;
